package com.system.basic.sequence.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2016-09-03 下午11:14:22 * @version: V 1.0 */public class Sequence extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     * 序列key     */    private String seqKey ;    /**     * 序列值     */    private Long seqValue ;    /**     * 创建时间     */    private java.util.Date createTime ;    /**     * 更新时间     */    private java.util.Date updateTime ;    /**     * get:序列key     */    public String getSeqKey(){        return this.seqKey;    }    /**     * set：序列key     */    public void setSeqKey(String seqKey){        this.seqKey=seqKey;    }    /**     * get:序列值     */    public Long getSeqValue(){        return this.seqValue;    }    /**     * set：序列值     */    public void setSeqValue(Long seqValue){        this.seqValue=seqValue;    }    /**     * get:创建时间     */    public java.util.Date getCreateTime(){        return this.createTime;    }    /**     * set：创建时间     */    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }    /**     * get:更新时间     */    public java.util.Date getUpdateTime(){        return this.updateTime;    }    /**     * set：更新时间     */    public void setUpdateTime(java.util.Date updateTime){        this.updateTime=updateTime;    }}